import './App.css';
import React from 'react'
import { Link, BrowserRouter as Router, Route} from 'react-router-dom';
import PickLeagues from './PickLeagues';


class Signup extends React.Component {


    constructor(props) {

        super(props)

        this.state = {
            email: 'defaultEmail'
        }

        this.handleClick = this.handleClick.bind(this);
    }

   handleClick(){

        this.setState({
            email: "testEmailState"
        })

    }

    render() {

        return (

            <div >
                <h2>Signup</h2>

                <div className="signup-form-items">
                    <label htmlFor="email">Enter email</label>
                    <input id="email" type="email" placeholder="Email address..."></input>
                </div>

                <div className="signup-form-items">
                    <label htmlFor="password">Enter password</label>
                    <input id="password" type="password" placeholder="Password..."></input>
                </div>



                <Link to="./">
                    <button className="btn btn-dark">Go Back</button>
                </Link>

                <Router>
                    <Route path="/PickLeagues" 
                        render={
                            (props) => (<PickLeagues email = {this.state.email} />)
                            } />
                </Router>


                <Link to="./PickLeagues">
                    <button className="btn btn-dark">Next</button>
                </Link>


            </div>
        );
    }
}

export default Signup;
